/*Table structure for table `config` */

DROP TABLE IF EXISTS `config`;

CREATE TABLE `config` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `parameter` varchar(255) COLLATE utf8_spanish2_ci DEFAULT NULL,
  `ivalue` int(12) DEFAULT '0',
  `dvalue` decimal(18,2) DEFAULT '0.00',
  `svalue` varchar(255) COLLATE utf8_spanish2_ci DEFAULT '-',
  `davalue` date DEFAULT '3000-01-01',
  `pvalue` decimal(5,2) DEFAULT '0.00',
  `status` char(1) COLLATE utf8_spanish2_ci DEFAULT 'A' COMMENT '(A)ctive - (I)nactive',
  `dat_add` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `usr_add` int(6) DEFAULT '0',
  `dat_upd` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `usr_upd` int(6) DEFAULT '0',
  `dat_del` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `usr_del` int(6) DEFAULT '0',
  PRIMARY KEY (`id`)
