/* Procedure structure for procedure `pai_recolecta` */

/*!50003 DROP PROCEDURE IF EXISTS  `pai_recolecta` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `pai_recolecta`(
	in nume varchar(50),
	in frec date, 
	in idem int,
	in idtr int,
	in cocl char(10),
	in dir longtext,
	in tlfn varchar(255),
	in bult int,
	in peso decimal(6,2),
	in fact int,
	in guia varchar(50),
	in cont varchar(255),
	in iden int,
	in prec varchar(255),
	in val  decimal(18,2),
	in cnft	int,
	in idpg	int,
	in obs 	longtext,
	in esta char(1),
	in idus	int)
BEGIN
	INSERT INTO toolbox.recolecta (
		numero,
		fch_rec,
		id_emp,
		id_transporte,
		co_cli,
		dir,
		telefonos,
		bultos,
		peso,
		fact_num,
		guia,
		contenido,
		id_tipo_env,
		precinto,
		valor,
		cant_fact,
		id_pago,
		observaciones,
		estatus,
		usr_cre) 
	VALUES(
		nume,
		frec,
		idem,
		idtr,
		cocl,
		dir,
		tlfn,
		bult,
		peso,
		fact,
		guia,
		cont,
		iden,
		prec,
		val, 
		cnft,
		idpg,
		obs,
		esta,
		idus) ;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `par_recolecta` */

/*!50003 DROP PROCEDURE IF EXISTS  `par_recolecta` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `par_recolecta`(
	IN opt INT,
	IN prm INT,
	IN prm2 int)
BEGIN 	
	IF opt = 1 THEN /*AEROCAV*/
		SELECT	recolecta.numero,
			recolecta.fch_rec,
			empresa.nombre,
			empresa.dir,
			empresa.rif,
			CONCAT(empresa.tlfn1, ' ' , empresa.tlfn2) AS telefonos, 
			ciudades.descr AS ciudad,
			clientes.cli_des,
			recolecta.dir,
			recolecta.telefonos,
			recolecta.`bultos`,
			recolecta.`peso`,
			recolecta.guia,
			recolecta.contenido,
			recolecta_tipo_env.tipo, 
			recolecta.precinto,
			recolecta.valor,
			recolecta.cant_fact,
			recolecta_tipo_pag.tipo, 
			recolecta.observaciones
		FROM 	toolbox.empresa
			INNER JOIN toolbox.recolecta 
				ON (empresa.id = recolecta.id_emp)
			INNER JOIN toolbox.clientes 
				ON (recolecta.co_cli = clientes.co_cli)
			INNER JOIN toolbox.ciudades 
				ON (ciudades.id = empresa.id_ciudad)
			INNER JOIN toolbox.recolecta_tipo_env 
				ON (recolecta_tipo_env.id = recolecta.id_tipo_env)
			INNER JOIN toolbox.recolecta_tipo_pag 
				ON (recolecta.id_pago = recolecta_tipo_pag.id)
		WHERE	recolecta.id_emp = prm AND
			recolecta.fact_num = prm2;
	END IF;	
END */$$
DELIMITER ;

/* Procedure structure for procedure `pas_config` */

/*!50003 DROP PROCEDURE IF EXISTS  `pas_config` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `pas_config`(
	in opt int,
	in prm varchar(255))
BEGIN
	IF opt = 1 THEN /*Todos los Activos*/	
		Select	parameter,
			ivalue,
			dvalue,
			svalue,
			davalue,
			pvalue
		from 	toolbox.`config`
		WHERE	status = 'A';
	END IF;
	IF opt = 2 THEN /*Por Parametro*/	
		SELECT	parameter,
			ivalue,
			dvalue,
			svalue,
			davalue,
			pvalue
		FROM 	toolbox.`config`
		WHERE	STATUS = 'A' and
			upper(parameter) = @prm;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `pas_empresa` */

/*!50003 DROP PROCEDURE IF EXISTS  `pas_empresa` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pas_empresa`(IN opt INT)
BEGIN 
	IF opt = 1 THEN /*Todos*/
		SELECT 	empresa.id,
			empresa.siglas,
			empresa.nombre,
			empresa.rif,
			empresa.dir_fis,
			empresa.dir,
			paises.descr AS pais,
			estados.descr AS estado,
			ciudades.descr AS ciudad,
			empresa.tlfn1,
			empresa.tlfn2,
			empresa.email,
			empresa.website,
			empresa.contacto
		FROM 	toolbox.paises
			INNER JOIN toolbox.empresa 
				ON (paises.id = empresa.id_pais)
			INNER JOIN toolbox.estados 
				ON (empresa.id_estado = estados.id)
			INNER JOIN toolbox.ciudades 
				ON (empresa.id_ciudad = ciudades.id)
		WHERE	(empresa.estatus ='A'); 
	END IF;	
	IF opt = 2 THEN /*Corporacion*/		
		SELECT 	empresa.id,
			empresa.siglas,
			empresa.nombre,
			empresa.rif,
			empresa.dir_fis,
			empresa.dir,
			paises.descr AS pais,
			estados.descr AS estado,
			ciudades.descr AS ciudad,
			empresa.tlfn1,
			empresa.tlfn2,
			empresa.email,
			empresa.website,
			empresa.contacto
		FROM 	toolbox.paises
			INNER JOIN toolbox.empresa 
				ON (paises.id = empresa.id_pais)
			INNER JOIN toolbox.estados 
				ON (empresa.id_estado = estados.id)
			INNER JOIN toolbox.ciudades 
				ON (empresa.id_ciudad = ciudades.id)
		WHERE	Empresa.id = 1;
	END IF;		
	IF opt = 3 THEN /*Suspension*/		
		SELECT 	empresa.id,
			empresa.siglas,
			empresa.nombre,
			empresa.rif,
			empresa.dir_fis,
			empresa.dir,
			paises.descr AS pais,
			estados.descr AS estado,
			ciudades.descr AS ciudad,
			empresa.tlfn1,
			empresa.tlfn2,
			empresa.email,
			empresa.website,
			empresa.contacto
		FROM 	toolbox.paises
			INNER JOIN toolbox.empresa 
				ON (paises.id = empresa.id_pais)
			INNER JOIN toolbox.estados 
				ON (empresa.id_estado = estados.id)
			INNER JOIN toolbox.ciudades 
				ON (empresa.id_ciudad = ciudades.id)
		WHERE	Empresa.id = 2;
	END IF;	
END */$$
DELIMITER ;

/* Procedure structure for procedure `pas_recolecta` */

/*!50003 DROP PROCEDURE IF EXISTS  `pas_recolecta` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pas_recolecta`(
	IN opt INT,
	IN prm INT,
	IN prm2 char(12))
BEGIN 
	IF opt = 1 THEN /*Todos*/
		SELECT	date_format(recolecta.fch_rec,'%d-%m-%Y') as fch_rec,
			recolecta.numero,
			clientes.cli_des,
			recolecta.dir,
			recolecta.telefonos,
			recolecta.bultos,
			recolecta.peso,
			recolecta.guia,
			recolecta.contenido,
			recolecta_tipo_env.tipo,
			recolecta.precinto,
			recolecta.valor,
			recolecta.cant_fact,
			recolecta_tipo_pag.tipo,
			recolecta.observaciones
		FROM	toolbox.recolecta
				INNER JOIN toolbox.clientes ON (recolecta.co_cli = clientes.co_cli)
				INNER JOIN toolbox.recolecta_tipo_env ON (recolecta.id_tipo_env = recolecta_tipo_env.id)
				INNER JOIN toolbox.recolecta_tipo_pag ON (recolecta.id_pago = recolecta_tipo_pag.id)
		WHERE 	(recolecta.estatus ='A');			
	END IF;	
	IF opt = 2 THEN /*Especifica*/		
		SELECT	recolecta.id,
			recolecta.numero,
			recolecta.fch_rec,'%d-%m-%Y',
			recolecta.co_cli,
			recolecta.dir,
			recolecta.telefonos,
			recolecta.bultos,
			recolecta.peso,
			recolecta.guia,
			recolecta.contenido,
			recolecta.id_tipo_env,
			recolecta.precinto,
			recolecta.valor,
			recolecta.cant_fact,
			recolecta.id_pago,
			recolecta.observaciones
		FROM	toolbox.recolecta			
		WHERE 	(recolecta.estatus ='A') AND
			(recolecta.id_emp = prm) AND
			(recolecta.fact_num = prm2);
	END IF;	
END */$$
DELIMITER ;

/* Procedure structure for procedure `pas_security` */

/*!50003 DROP PROCEDURE IF EXISTS  `pas_security` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pas_security`(
	IN opt INT,
	IN usid INT,
	IN pcna CHAR(255))
BEGIN 
	IF opt = 1 THEN /*PC Name*/
		SELECT	IFNULL(mnu_opt,0) AS mnu_opt 
		FROM 	SECURITY
		WHERE	ucase(pc_name) = pcna; 
	END IF;	
	IF opt = 2 THEN /*User ID*/		
		SELECT	IFNULL(mnu_opt,0) AS mnu_opt 
		FROM 	SECURITY
		WHERE	id_user = usid;
	END IF;	
END */$$
DELIMITER ;

